import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
// components
import FormProvider from './components/hook-form/FormProvider';
import RHFTextField from './components/hook-form/RHFTextField';
import { LoadingButton } from '@mui/lab';
// form
import * as Yup from 'yup';
import { useForm } from 'react-hook-form';
import { yupResolver } from '@hookform/resolvers/yup';
// @mui
import { styled } from '@mui/material/styles';
import { Grid, Box, IconButton, Container, Typography, Stack, Card, CardHeader, CardContent} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
// notistack
import { useSnackbar } from 'notistack';
// Axios
import _axios from 'axios';
// ----------------------------------------------------------------------

// const RootStyle = styled('div')(({ theme }) => ({
//   [theme.breakpoints.up('md')]: {
//     display: 'flex'
//   }
// }));

const ContentStyle = styled('div')(({ theme }) => ({
  maxWidth: 700,
  margin: 'auto',
  padding: theme.spacing(2)
}));

// ----------------------------------------------------------------------
export async function getStaticProps() {
  return {
    props: {}
  };
}

export default function App(props) {
  const { enqueueSnackbar } = useSnackbar();
  const [weather, setWeather] = useState();
  const [weatherList, setWeatherList] = useState([]);

  const FormSchema = Yup.object().shape({
    locale: Yup.string()
  });

  const methods = useForm({
    resolver: yupResolver(FormSchema),
    // defaultValues
  });

  const {
    handleSubmit,
    formState: { isSubmitting }
  } = methods;

  const onSubmit = async (data) => {
    console.log(data)
    await _axios
      .get(`https://api.openweathermap.org/data/2.5/weather`, {
        params: {
          units: "metric",
          q: data.country,
          appid: process.env.REACT_APP_API_KEY,
        },
      })
      .then((res) => {
        console.log(res.data);
        setWeather(res.data);
        // setWeather({ [res.data.data.login]: res.data.data });
      })
      .catch((error) => {
        enqueueSnackbar(error.message, {
          variant: 'error'
        });
      });
  };

  return (
    <ContentStyle>
      <FormProvider methods={methods} onSubmit={handleSubmit(onSubmit)}>
        <Card style={{ border: "none", boxShadow: "none" }}>
          <CardHeader
            sx={{ p:0 }}
            action={
              <IconButton sx={{ p: 3 }} aria-label="settings" type="submit" id="submitButton">
                <SearchIcon />
              </IconButton>
            }
            title={
              <RHFTextField
                InputProps={{ sx: { borderRadius: 5 } }}
                sx={{ 
                  mr: 5
                }}
                name="country"
                label="Country"
              />
            }
          />
        </Card>
      </FormProvider>
      <Box sx={{ my: 5}}>
        {weather && <Card 
          style={{ border: "none", boxShadow: "none", backgroundColor: ""}}
          sx= {{ borderRadius: 5 }}
        >
          <CardContent>
            <Typography variant="body1" sx={{ fontWeight: 'bold' }}>
              Today's Weather
            </Typography>
            <Typography variant="h1" sx={{ fontWeight: 'bold' }}>
              {Number(weather.main.temp.toFixed(0))}Â°
            </Typography>
            <Typography variant="body1" sx={{ fontWeight: 'bold' }}>
              H: {weather.main.temp_max}   L: {weather.main.temp_min}
            </Typography>
            <Stack direction={{ xs: 'column', sm: 'row' }} spacing={{ xs: 0, sm: 2, md: 4 }}>
              <Typography variant="body1" sx={{ fontWeight: 'bold'}}>
                {weather.name}, {weather.sys.country}
              </Typography>
              <Typography variant="body1">
                {weather.main.temp_max}
              </Typography>
              <Typography variant="body1">
                Humidity: {weather.main.humidity}%
              </Typography>
              <Typography variant="body1">
                {/* Coulds: {weather.coulds.all}% */}
                Coulds: {weather.coulds}%
              </Typography>
            </Stack>

            <Grid container spacing={3}>
              <Grid item xs={3}>
                <Typography sx={{ fontWeight: 'bold', typography: { sm: 'body1', xs: 'body2' } }}>
                  {weather.name}, {weather.sys.country}
                </Typography>
              </Grid>
              <Grid item xs={3}>
                <Typography sx={{ margin: 'auto', typography: { sm: 'body1', xs: 'body2' } }}>
                  {weather.main.temp_max}
                </Typography>
              </Grid>
              <Grid item xs={3}>
                <Typography sx={{ margin: 'auto', typography: { sm: 'body1', xs: 'body2' } }}>
                  Humidity: {weather.main.humidity}%
                </Typography>
              </Grid>
              <Grid item xs={3}>
                <Typography sx={{ margin: 'auto', typography: { sm: 'body1', xs: 'body2' } }}> 
                  {/* Coulds: {weather.coulds.all}% */}
                  Coulds: {weather.coulds}%
                </Typography>
              </Grid>
            </Grid>
          </CardContent>
        </Card>}
      </Box>
    </ContentStyle>

  );
}
